import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './index.css';
import './style.css';

// pages
import Master from './Master';
import Login from ''

function App() {
  return (
    <>
    <Router>
      <Routes>
        <Route path='' element={<Master/>}>
          <Route path='' element={<Login/>}></Route>
        </Route>
      </Routes>
    </Router>
    </>
  );
}

export default App;
